import React from 'react';
import './home.scss';

const Home = () => {
    return (
        <React.Fragment className="home-page">
            <div className="logo">SmartCode</div>
            <nav className="navbar navbar-light bg-light">
                <a className="navbar-brand" href="#">
                    <div className="logo">SmartCode</div>
                </a>
            </nav>
        </React.Fragment>
    )
}

export default Home;
